Appreiciation Post🥹❤️… To the man who can play so many different roles in your reel and real life and I guarantee it will always feel that authentic and with ease. Father figure, best friend, someone who will care for you silently more than sometimes you will care for yourself. 20 years ago I had the privilege of being cast in a beautiful movie Viruddh but little did I know that I would be cast for real into a family that will make you feel loved no matter how many years go by. 20 years later I was cast in Juna Furniture, once again by Mahesh sir who never stopped giving me opportunities and encouragement and an abundance of lessons and love. If he believes in you, it’s real. If he teaches you, you grow. If he captures your heart you’ve captured his. This film made me want to work harder, be better and most importantly do justice that Mahesh sir’s made the right choice in betting on me again. What no one knows is besides all these invaluable lessons I learnt in and around the sets… something I learnt beyond the reel life from this film was that I haven’t showed up for Mahesh sir, I didn’t stay in touch or check in when I absolutely should have. Even when I didn’t know he wasn’t well and only found out after he recovered I should have showed up instead of feeling ashamed. And all along he was following my career and cheering me on in silence and even when I started BrownSkin Beauty he was a fan and would regularly buy products and use them and I had absolutely no idea! When I found out I burst in to tears with the same insane guilt knowing once again he was always there and I just need to be and do much better. Here’s to making sure I always go visit him and his family and to make sure I’m always checking in because it’s what I want to do and I feel like the luckiest girl to have people like him that are so genuine and true. To you Mahesh sir the most talented, strongest, most loving and caring man I have the privilege of knowing and hugging. Love you infinity♾️

And here’s to Juna Furniture a film that will teach you and spread love.

@maheshmanjrekar ❤️

